import React, { useState } from 'react';
import axios from 'axios';

const GamerForm = () => {
  const [gamerData, setGamerData] = useState({
    teamname: '',
    email: '',
    collegename: '',
    membernameone: '',
    membernametwo: '',
    membernamethree: '',
    membernamefour: '',
  });

  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setGamerData({
      ...gamerData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('https://valyriansteelchallenge.onrender.com/api/gamers', gamerData);
      setMessage('Gamer details submitted successfully!');
    } catch (error) {
      setMessage('Failed to submit gamer details.');
      console.error('Error submitting gamer details:', error);
    }
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-bold mb-4">Gamer Registration</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="teamname">Team Name</label>
          <input
            type="text"
            name="teamname"
            id="teamname"
            value={gamerData.teamname}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="email">Email</label>
          <input
            type="email"
            name="email"
            id="email"
            value={gamerData.email}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="collegename">College Name</label>
          <input
            type="text"
            name="collegename"
            id="collegename"
            value={gamerData.collegename}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="membernameone">Member 1 Name</label>
          <input
            type="text"
            name="membernameone"
            id="membernameone"
            value={gamerData.membernameone}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="membernametwo">Member 2 Name</label>
          <input
            type="text"
            name="membernametwo"
            id="membernametwo"
            value={gamerData.membernametwo}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="membernamethree">Member 3 Name</label>
          <input
            type="text"
            name="membernamethree"
            id="membernamethree"
            value={gamerData.membernamethree}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-bold mb-2" htmlFor="membernamefour">Member 4 Name</label>
          <input
            type="text"
            name="membernamefour"
            id="membernamefour"
            value={gamerData.membernamefour}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg"
            required
          />
        </div>
        <button type="submit" className="w-full bg-blue-500 text-white font-bold py-2 px-4 rounded-lg hover:bg-blue-600">
          Submit
        </button>
      </form>
      {message && <p className="mt-4 text-center">{message}</p>}
    </div>
  );
};

export default GamerForm;
